function BrushIt(here)
{
	if($(here).style.backgroundColor=="" || $(here).style.backgroundColor==null)
		$(here).style.backgroundColor="#ffffff";
	if(ff) 
		$(here).style.backgroundColor=rgbToHex($(here).style.backgroundColor);
